    componentDidMount() {

    }

    render() {

        return (
            <div className="container" style={{marginTop:'2%'}}>
            <h6 className="text-center">Formulaire</h6>
                <div className="row">

                    <div className="col-6">
                        <InputClient />
                    </div>
                    <div className="col-6">
                        <InputService />
                    </div>
                </div>
            </div>
        )
    }
}
